INSERT INTO `news` (`id`, `name`, `new`, `kas`, `data`, `likes`, `unlike`) VALUES
(1, 'Pakeitimai,smulkmenos', 'Padarytas restartas, kadangi žaidimas pradžei būvo paleistas nedakurtas. Pamažinti visų monstrų duodamų zenų kiekiai,taip pat ir exp. Pakeistas stilius ir dar daug smulkių pakeitimų.Žaidimas perkuriamas.Tad laukit starto sekit naujienas.', 'alkotester', '1418603923', 0, 0),
(2, 'Pasiekimai', 'Į pasiekimus idėta gyvybių pasiekimai.', 'alkotester', '1418758146', 0, 0),
(3, 'Specialios technikos', 'Sutvarkyta klaida Specialiose technikose.Pridėdavo daugiau procentų nei turėjo dabar pridės atitinkama kiekį kiek ir priklauso.', 'alkotester', '1419274943', 0, 0),
(4, 'Klaida pasiekimuose', 'Sutvarkyta klaida su gynybos pasiekimų kai paspausdavo rašydavo kad dar negali vygdyti jo. Dabar galės vygdyt.', 'alkotester', '1419280649', 0, 0),
(5, 'SMS TOP', 'Sutvarkyta sms top klaida dėl kurios apkraudavo visa serverį.Ši klaida sutvarkyta.', 'alkotester', '1419289524', 0, 0),
(6, 'Klaida kovose', 'Ištaisyta klaida kovose.Buvo taip kad jei žaidėjas kovoja per 2 skirtingas naršyklė jam užskaitydavo ne kaip 1 veiksma o 2. .Ir tokių būdų darydavo po 2 veiksmus.', 'alkotester', '1419296914', 0, 0),
(7, 'Kalėdos', 'Sukurta kalėdinė dovana, kuri Gruodžio 25-tą dieną atsiras Mieste. ;)', 'wdxkioksas', '1419343896', 0, 0),
(8, 'Susijungimo Klaida', 'Sutvarkyta susijungimo klaida, dabar KG turėtų pridėti normaliai.', 'wdxkioksas', '1419372491', 0, 0),
(9, 'Informacijos užslaptinimas', 'Dabar paslaugose už litus galėsite užsisakyti naują paslaugą, t.y <b>Informacijos užslaptinimas</b>, paslaugos kaina <b>10LT/7d.</b>', 'flyer', '1419376676', 0, 0),
(10, 'Savaitės Kovų Konkursas', 'Angel prašymu sukurtas savaitės kovų konkursas, jį rasite prie dienos topų. :)', 'wdxkioksas', '1419379455', 0, 0),
(11, 'Kūčios', 'Sveikinu visus sulaukus Šv. Kūčių. :) Ta progra padidints Event&#039;o su snaigėmis alygis. :) Nepersivalgykit šiandien. :D', 'wdxkioksas', '1419415145', 0, 0),
(12, 'Atnaujinimai', 'Žaidėjo deluxe prašymu,atliktas pasiulymas - Padarius atnaujinima,rašys kas tą atnaujinima atliko. Sekmės žaidime ;) .', 'flyer', '1419422939', 0, 0);
